export default function App() {
  return (
    <Context.Provider value={{user, setUser, URL}}>
      <BrowserRouter>
        <GlobalStyle />
        <Routes>
          <Route path='/' element={<LogIn />}></Route>
          <Route path='/cadastro' element={<SignIn />}></Route>
          <Route path='/hoje' element={<Today />}></Route>
        </Routes>
      </BrowserRouter>
    </Context.Provider>
  );
}
